$(".todolist-save").on("click",function(){var b=$("#todolistTitle").val();var a=$(this).data("url");$.ajax({url:a,type:"POST",data:{title:b},success:function(c){$("ul.todo-list").html(c);$("#todolistModal").modal("hide")}})});$("input").on("ifChecked",function(c){var a=c.type;var b=$(".todolist-save").data("url");if(a=="ifChecked"){$.ajax({url:b,type:"POST",data:{id:$(this).val()},success:function(d){}})}});$("#todolistPasive").on("click",function(){var a=$(".todolist-save").data("url");$.ajax({url:a,type:"POST",data:{type:1},success:function(b){$("ul.todo-list").html(b)}})});$("#todolistActive").on("click",function(){var a=$(".todolist-save").data("url");$.ajax({url:a,type:"POST",data:{type:0},success:function(b){$("ul.todo-list").html(b)}})});